import React, { Component } from 'react';

import SlideInTrigger from './SlideInTrigger';
import ResourcePane from './ResourcePane';
import Cytoscape from './Cytoscape';







class MainUI extends Component {
  constructor(props){
    super(props);
    this.state ={
      current_tab:'0',
    }


  };








  render() {
    const {
      toggleSlideIn,
      addTab,
      remove_tab,
      fileManager,
      showResourcePane

    } = this.props;


    return (
            /* Main UI: START */

    <main id="panel" className="panel">
      <div className="ui-container">
          <ResourcePane 
              addTab = {addTab}
              current_tab = {this.props.current_tab}
              tabs={this.props.tabs}
              remove_tab={this.props.remove_tab}
              showResourcePane={this.props.showResourcePane}
              setActiveTab={this.props.setActiveTab}
              fileManager={this.props.fileManager}
              change_title={this.props.change_title}
              change_content={this.props.change_content}
              setType={this.props.setType}
              set_focus={this.props.set_focus}
              focus = {this.props.focus}
              setSelectedText={this.props.setSelectedText}


         />
          <div className="splitter" id="splitter">
          </div>

          <div className="visualisation-pane">
              <div id="navbar">

                  <SlideInTrigger
                    className="btn-hamburger toggle-button"
                    onClick={toggleSlideIn}
                    showResourcePane={showResourcePane}
                    loadDemoArgument={this.loadDemoArgument}
                  />
              </div>
                <Cytoscape
                cy_data = {this.props.cy_data}
                setCyData = {this.props.setCyData} 
                handleSetPng = {this.props.handleSetPng}
                handleSetJpg = {this.props.handleSetJpg}
                loadJSON = {this.props.loadJSON}
                selectedText = {this.props.selectedText}
                clearSelection ={this.props.clearSelection}

                />
          </div>
      </div>
    </main>

   /* Main UI: END */
    );
  }
}










export default MainUI;
